import React, { useEffect } from "react";

import { useRouter } from "next/router";
import axios from "axios";
import post from "../../UtilFunctions/post";
import { backend_url } from "../../url";

interface IProps {}

const Google: React.FC<IProps> = () => {
  const router = useRouter();
  const { code } = router.query;

  console.log(code);

  useEffect(() => {
    if (code) {
      axios({
        method: "get",
        url: `/api/auth/google?get=user&code=${code}`,
      }).then((res) => {
        console.log(res.data.user.data.tokens.id_token);
        const id_token = res.data.user.data.tokens.id_token;

        post(
          `${backend_url}/api/auth/google/verify`,
          { id_token: id_token, google_id: google_id },
          (response: any) => {
            setUser(response.data);
          },
          () => {
            signOut();
          }
        );
      });
    }
  }, [code]);

  return <p>hello</p>;
};

export default Google;
